import React from 'react';
import './Header.css';
import logo from '../../assets/logo.svg';
import { Button } from '@material-ui/core';

const Header = function () {
    let accessToken = false;
    return (
        <div className="header">
            <span>
            <img src={logo} className='logo'></img>
            </span>
            <Button variant="contained" className='login' href='http://localhost:8085/v1/auth/login'>
                Login
            </Button>
            <Button variant="contained" className='logout' href='http://localhost:8085/v1/auth/logout' disabled={accessToken}>
                Logout
            </Button>
        </div>
    )
}

export default Header;
